  false,\n\t\"url\": null,\n\t\"notes\": \"BPI Zones are derived from a focal mean
  analysis on bathymetry and slope. The grid is based on gridded (10 m cell size)
  multibeam bathymetry, collected aboard NOAA Ship Hi'ialakai and R/V AHI, and it
  was created using the Benthic Terrain Modeler (http://www.csc.noaa.gov/products/btm/).
  Cell values represent one of 4 classes (crest, depression, flat, slope) in an index
  of seafloor terrains. This data set is for the shelf and slope environments of Maug
  Island.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
